  true,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Department of Energy's National
  Renewable Energy Laboratory collaborates with the solar industry to establish high
  quality solar and meteorological measurements. This Solar Resource and Meteorological
  Assessment Project (SOLRMAP) provides high quality measurements to support deployment
  of power projects in the United States. The no-funds-exchanged collaboration brings
  NREL solar resource assessment expertise together with industry needs for measurements.
  The end result is high quality data sets to support the financing, design, and monitoring
  of large scale solar power projects for industry in addition to research-quality
  data for NREL model development. NREL provides consultation for instrumentation
  and station deployment, along with instrument calibrations, data acquisition, quality
  assessment, data distribution, and summary reports. Industry participants provide
  equipment, infrastructure, and station maintenance.\",\n\t\"license_title\": \"Creative
